import React from 'react'

import './header.css'
import ic_menu_book_prim from '../assets/menu_book-prim.svg'

export const Header = (props) => {
  return (
  <div className="debug header">
    <img src={ic_menu_book_prim}/>
    <div className="icon-container-header">
      <img src={ic_menu_book_prim}/>
    </div>
    <h2>{props.title}</h2>
    <img src={ic_menu_book_prim}/>
  </div>
  )
}

